import React, { Component } from 'react';
import './../App.css';
import Sell from './component/Sell';
import Buy from './component/Buy';

class Combine extends Component {
  render() {
    return (
      <div>
        <main className="kolom">
        <Sell />
        <Buy />
        </main>
      </div>
    );
  }
}
export default Combine;
